Используется при любом уровне физических нагрузок и почти в любую погоду: от + 20С до - 15С (с соответствующей верхней одеждой); 
Полностью анатомический крой; 
Улучшенный дизайн; 
Прекрасно выводит влагу, позволяет телу дышать, сохраняет тепло; 
Быстросохнущий, влагоотводящий полиэфир (полиэстер) Quick Dry PE 80%; 
Полиамидная микрофибра PA 15%; 
Эластан EL 5%. 
Благодаря уникальному сочетанию современных высококачественных материалов и функционального дизайна, учитывающего анатомию человека, термобелье полностью повторяет форму тела человека и создает максимальный комфорт при занятии активными видами спорта (лыжи, бег, велосипед, фитнес и т.д.). Характерной особенностью данного термобелья является наличие различных зон вязки. Связано оно бесшовно на итальянском оборудовании.

Специальные двухслойные термоноски сочетают в себе необходимые для зимних прогулок и активного отдыха свойства. Полиэстер обеспечивает отвод влаги от тела. А благодаря входящей в состав шерсти и двухслойной конструкции материала поддерживается комфортная температура ног.

Идеально подходят для:
Долгих прогулок зимой;
Занятий зимними видами спорта;
Холодной и очень холодной погоды;

Влагоотводящее двухслойное с антибактерицидной пропиткой;
Внутренний слой - полиэстер 100%;
Внешний слой- хлопок 100%;
Рекомендовано при пониженных температурах и высоких физических нагрузках, либо при работах в условиях повышенной влажности;
Эффективно при температуре от +5 до -20 , в сочетании с верхней одеждой.

Теплосберегающее двухслойное специального переплетения с воздушной прослойкой;
Внутренний слой - (гипоаллергенный) хлопок 100%;
Наружный слой шерсть 60%;
Акрил 40%;
Антибактерицидная пропитка;
Для низких и средних уровней физической активности и пониженных температур от 0 до -35 в качестве первого слоя одежды, в сочетании с верхним слоем зимней одежды.

